// React Native usage example
import { ONNX } from 'onnxjs';

// Load model
const session = new ONNX.InferenceSession();
await session.loadModel('path/to/carb_classifier.onnx');

// Preprocess image
const tensor = preprocessImage(imageUri);

// Run inference
const output = await session.run([tensor]);
const predictions = output.values().next().value.data;

// Get top prediction
const maxIndex = predictions.indexOf(Math.max(...predictions));
const predictedClass = classNames[maxIndex];
